import React from "react";
import "./header.css";

function Header() {
  return (
    <div className="header">
      <div className="headerTtiles">
        <span className="headerTilesSm">React & Node</span>
        <span className="headerTitlelg">Blog</span>
      </div>
      <img className="headerImg" src="images/home.jpg" alt="home" />
    </div>
  );
}

export default Header;
